  `id` varchar(64) NOT NULL,
  `contract_code` varchar(64) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '合同id',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【待定】',
  `inn_ru` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【待定】',
  `kpp_ru` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '【待定】',
  `legal_address` varchar(255) DEFAULT NULL,
  `office_address` varchar(255) DEFAULT NULL,
  `created_time` datetime NOT NULL COMMENT '创建时间',
  `updated_time` datetime NOT NULL COMMENT '更新时间',
