  `cancel_msg_code` int DEFAULT '0' COMMENT '取消原因代码',
  `updated_time` datetime DEFAULT NULL,
  `created_time` datetime DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fm_id` (`frank_machine_id`),
  KEY `flow` (`flow`),
