  PRIMARY KEY (`id`),
  KEY `s_id` (`transaction_id`,`count`,`amount`,`created_time`,`dm_msg`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=202 DEFAULT CHARSET=utf8;

